import React from "react";
import styles from "./userManageListTag.module.css"

function UserManageListTag() {
  return (
    <div className={styles.userManageSection}>
      <div className={styles.isCheck}>
        <input type="checkbox"></input>
      </div>
      <div className={styles.uId}>식별번호</div>
      <div className={styles.id}>아이디</div>
      <div className={styles.uName}>이름</div>
      <div className={styles.uEmail}>이메일</div>
      <div className={styles.uNum}>휴대전화</div>
      <div className={styles.uAddr}>주소</div>
    </div>
  );
}

export default UserManageListTag;
